import React from 'react';
import TeamMember from './TeamMember';
function Team() {
	return (
		<div className='row'>
			<TeamMember name='eman'/>
			<TeamMember name='asma'/>
			<TeamMember name='saud'/>
		</div>
	);
}
export default Team;
